import React from "react";
import NotLoggedIn from "./NotLoggedIn"

export default class LoginForm extends React.Component {
  constructor() {
    super();
    this.state = {};
  }
  notLoggedIn = () => {
      return(
          <NotLoggedIn></NotLoggedIn>
      )
  };

  render() {
    return (
      <div>
        <h1>Hello</h1>
      </div>
    );
  }
}
